import '../cart-dropdown/cart-dropdown.styles.scss'
const CartDropDown = () => {
  return (
    <div className='cart-dropdown-container'>
      <div className='cart-items'></div>
      <Button style={{ 'border-radius': '0px' }} buttonType='inverted'>
        Go to Checkout
      </Button>
    </div>
  )
}

